import React from 'react';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Header from './components/Header';
import ReverseMax from './components/ReverseMax';
import CalculationModal from './CalculationModal';


function App() {

  return (
    <div className="App">

    <Header/>

    <Grid container direction="row" justify="center" alignItems="center">

    <Grid container item xs={12} justify="center" alignItems="center"><ReverseMax/></Grid>

    </Grid>

    <CalculationModal/>

    </div>
  );
}

export default App;
